import React from "react";
import LazyTable from "../components/LazyTable"; // Assuming LazyTable is in the components folder
import "../style/SearchPage.css";

export default function MusicInsights() {
  // Define the columns for each feature
  const danceabilityColumns = [
    { field: "title", headerName: "Track Title", width: 200 },
    { field: "genre_name", headerName: "Genre", width: 150 },
    { field: "danceability", headerName: "Danceability", width: 150 },
  ];

  const loudnessColumns = [
    { field: "loudness_rank", headerName: "Rank", width: 100 },
    { field: "title", headerName: "Track Title", width: 200 },
    { field: "genre_name", headerName: "Genre", width: 150 },
    { field: "loudness", headerName: "Loudness (dB)", width: 150 },
  ];

  const audioProfilesColumns = [
    { field: "genre_name", headerName: "Genre", width: 150 },
    { field: "valence", headerName: "Valence", width: 100 },
    { field: "energy", headerName: "Energy", width: 100 },
    { field: "danceability", headerName: "Danceability", width: 150 },
    { field: "profile_count", headerName: "Profile Count", width: 150 },
  ];

  return (
    <div className="music-insights">
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/sound">Sound Lab</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

      <div id="page-wrapper">
        <h1>Music Insights</h1>

        {/* Tracks with Above-Average Danceability */}
        <section className="feature-section">
          <h2>Tracks with Above-Average Danceability</h2>
          <LazyTable
            route={`http://localhost:8080/aboveAverageDanceability`}
            columns={danceabilityColumns}
            defaultPageSize={5}
            rowsPerPageOptions={[5, 10, 25]}
          />
        </section>

        {/* Rank Tracks by Loudness */}
        <section className="feature-section">
          <h2>Rank Tracks by Loudness</h2>
          <LazyTable
            route={`http://localhost:8080/rankTracksByLoudness`}
            columns={loudnessColumns}
            defaultPageSize={10}
            rowsPerPageOptions={[10, 25, 50]}
          />
        </section>

        {/* Top Audio Profiles by Genre */}
        <section className="feature-section">
          <h2>Top Audio Profiles by Genre</h2>
          <LazyTable
            route={`http://localhost:8080/topAudioProfiles`}
            columns={audioProfilesColumns}
            defaultPageSize={5}
            rowsPerPageOptions={[5, 10, 25]}
          />
        </section>
      </div>
    </div>
  );



  return (
    <div>

      {/* Navigation Bar */}
      {/* 不要动 */}
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/search">Search Page</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

    </div>
  );
}
